import React from "react";

import Baby_Jogger from "../Pictures/Baby_Jogger.png";
import $ from "jquery";

import "../css/carousel.css";

function Carousel() {
  (function () {
    // setup your carousels as you normally would using JS
    // or via data attributes according to the documentation
    // https://getbootstrap.com/javascript/#carousel
    jQuery("#carousel123").carousel({ interval: 1000 });
    jQuery("#carouselABC").carousel({ interval: 1000 });
  })();

  (function () {
    $(".carousel-showmanymoveone .item").each(function () {
      var itemToClone = $(this);

      for (var i = 1; i < 4; i++) {
        itemToClone = itemToClone.next();

        // wrap around if at end of item collection
        if (!itemToClone.length) {
          itemToClone = $(this).siblings(":first");
        }

        // grab item, clone, add marker class, add to collection
        itemToClone
          .children(":first-child")
          .clone()
          .addClass("cloneditem-" + i)
          .appendTo($(this));
      }
    });
  })();

  return (
    <div>
      <div className="container">
        <div className="row">
          <div className="col-md-12">
            <div
              className="carousel carousel-showmanymoveone slide"
              id="carousel123"
            >
              <div className="carousel-inner">
                {/*1*/}
                <div className="item active">
                  <div className="col-xs-12 col-sm-6 col-md-3">
                    <img src={Baby_Jogger} className="img-responsive" />
                  </div>
                </div>
                <div className="item">
                  <div className="col-xs-12 col-sm-6 col-md-3"></div>
                </div>
                {/*2*/}
                <div className="item active">
                  <div className="col-xs-12 col-sm-6 col-md-3">
                    <img src={Baby_Jogger} className="img-responsive" />
                  </div>
                </div>
                <div className="item">
                  <div className="col-xs-12 col-sm-6 col-md-3"></div>
                </div>
                {/*3  */}
                <div className="item active">
                  <div className="col-xs-12 col-sm-6 col-md-3">
                    <img src={Baby_Jogger} className="img-responsive" />
                  </div>
                </div>
                <div className="item">
                  <div className="col-xs-12 col-sm-6 col-md-3"></div>
                </div>
                {/*the tools*/}
                <a
                  className="left carousel-control"
                  href="#carousel123"
                  data-slide="prev"
                >
                  <i className="glyphicon glyphicon-chevron-left"></i>
                </a>
                <a
                  className="right carousel-control"
                  href="#carousel123"
                  data-slide="next"
                >
                  <i className="glyphicon glyphicon-chevron-right"></i>
                </a>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
export default Carousel;
